        let options = el.find('.options li');
        let content = $('#content');

        // Open language dropdown panel

        el.on('click', function (e) {
            el.addClass('show-options');

            setTimeout(function () {
                el.addClass('anim-options');
            }, 50);

            setTimeout(function () {
                el.addClass('show-shadow');
            }, 200);
        });


        // Close language dropdown panel

        options.on('click'");
